pragma solidity >= 0.7.0 < 0.9.0;
 
contract allowance {

    

    mapping (address _addrOwner => uint) public allow;
    mapping (address _addrSpender => mapping (address _addrOwner => uint)) public allow2;
    
    function addContra (address _addrOwner,  uint id) public {
        allow[_addrOwner] = id;
    }
    
    

    //this function removes the spenders allowance
    /*function remove(address _addrOwner, address _addrSpender) public {
        delete allowance[_addrOwner][_addrSpender];
    */
    
}

